  \"2016-07-27T22:23:57.118793\",\n\t\"name\": \"yazoo-national-wildlife-refuge-and-hillside-national-wildlife-refuge-annual-narrative-rep--844a8\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Yazoo, Hillside,
  Panther Swamp, Morgan Brake, and Mathews Brake NWRs covers refuge activities during
  1985. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, volunteer programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, forests, croplands, grasslands, haying, fire management, and pest control.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, scientific collections, animal control, and marking
  and banding. The public uses of the Refuge described in this report include hunting,
  wildlife observation, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment replacement, communication systems, and energy conservation.
  Cooperative programs are provided at the end.\",\n\t\"license_title\": \"License
